CREATE FUNCTION public.generate_ielts_scores() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
  class_record RECORD;
BEGIN
  FOR class_record IN SELECT * FROM public.student_status_at_class LOOP
    IF random() < 0.4 THEN -- 40% chance of IELTSScore being bigger than endcoursepoint
      UPDATE public.student_status_at_class
      SET IELTSScore = class_record.endcoursepoint + (round(random() * 3) / 2.0) -- Generates 0, 0.5, 1, or 1.5
      WHERE StudentStatusID = class_record.StudentStatusID; 
    ELSE
      UPDATE public.student_status_at_class
      SET IELTSScore = class_record.endcoursepoint
      WHERE StudentStatusID = class_record.StudentStatusID;
    END IF;
  END LOOP;
END;
$$;


