CREATE FUNCTION public.generate_sample_data() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    i INTEGER;
    m INTEGER;
    y INTEGER;
    classid_prefix TEXT;
    classid_suffix TEXT;
    endcoursepoint REAL;
    joindate DATE;
    unpaidfees MONEY;
    studentstatus TEXT;
BEGIN
    FOR i IN 1..7350 LOOP
        m := i % 105;
        IF m = 0 OR m > 100 THEN -- Nếu m = 105 hoặc m > 100, không thêm vào bảng
            CONTINUE;
        END IF;
        y := i / 105;
        IF m <= 40 THEN
            IF m <= 20 THEN
                classid_prefix := 'IE35';
                classid_suffix := LPAD((0001 + 2*y)::TEXT, 5, '0');
            ELSE
                classid_prefix := 'IE35';
                classid_suffix := LPAD((0001 + 2*y + 1)::TEXT, 5, '0');
            END IF;
            IF m IN (1, 21) THEN
                endcoursepoint := 3.5;
            ELSIF m IN (2, 15, 28) THEN
                endcoursepoint := 4.5;
            ELSIF m IN (8, 16, 24, 32, 40) THEN
                endcoursepoint := 5.5;
            ELSE
                endcoursepoint := 6.5;
            END IF;
        ELSIF m BETWEEN 41 AND 60 THEN
            classid_prefix := 'IE45';
            classid_suffix := LPAD((0001 + y)::TEXT, 5, '0');
            IF m IN (41, 51) THEN
                endcoursepoint := 4.5;
            ELSIF m IN (42, 48, 54) THEN
                endcoursepoint := 5.5;
            ELSE
                endcoursepoint := 6.5;
            END IF;
        ELSIF m BETWEEN 61 AND 80 THEN
            classid_prefix := 'IE55';
            classid_suffix := LPAD((0001 + y)::TEXT, 5, '0');
            IF m IN (61, 71) THEN
                endcoursepoint := 5.5;
            ELSE
                endcoursepoint := 6.5;
            END IF;
        ELSIF m BETWEEN 81 AND 100 THEN
            classid_prefix := 'IE65';
            classid_suffix := LPAD((0001 + y)::TEXT, 5, '0');
            endcoursepoint := 6.5;
        END IF;

        IF i BETWEEN 1 AND 1050 THEN
            joindate := '2022-07-04';
        ELSIF i BETWEEN 1051 AND 2100 THEN
            joindate := '2022-10-03';
        ELSIF i BETWEEN 2101 AND 3150 THEN
            joindate := '2023-01-02';
        ELSIF i BETWEEN 3151 AND 4200 THEN
            joindate := '2023-04-03';
        ELSE
            joindate := '2023-07-04';
        END IF;

        IF (joindate = '2023-07-04' AND classid_prefix = 'IE35' AND endcoursepoint = 6.5) OR
           (joindate = '2023-10-03' AND classid_prefix = 'IE35' AND endcoursepoint = 6.5) OR
           (joindate = '2023-10-03' AND classid_prefix = 'IE45' AND endcoursepoint = 6.5) OR
           (joindate = '2024-01-02' AND classid_prefix = 'IE35' AND endcoursepoint = 6.5) OR
           (joindate = '2024-01-02' AND classid_prefix = 'IE45' AND endcoursepoint = 6.5) OR
           (joindate = '2024-01-02' AND classid_prefix = 'IE55' AND endcoursepoint = 6.5) THEN
            unpaidfees := ROUND(RANDOM() * 500000);
            studentstatus := 'Active';
        ELSE
            unpaidfees := 0;
            studentstatus := 'Inactive';
        END IF;

            studentstatusid, midtermscore, finaltermscore, absence, unpaidfees, 
            studentstatus, joindate, ieltsscore, endcoursepoint, ratingstar, 
            classid, studentid
        )
        VALUES (
            'SS' || LPAD(i::TEXT, 4, '0'), -- StudentStatusID
            ROUND(2 * (7 + RANDOM() * 3)) / 2::REAL, -- MidtermScore
            ROUND(2 * (7 + RANDOM() * 3)) / 2::REAL, -- FinaltermScore
            ROUND(RANDOM() * 4)::INTEGER, -- Absence
            unpaidfees, -- Unpaidfees
            studentstatus, -- StudentStatus
            joindate, -- JoinDate
            NULLIF(ROUND(2 * endcoursepoint) / 2, 0), -- IELTSScore
            endcoursepoint, -- Endcoursepoint
            ROUND(1 + RANDOM() * 2)::INTEGER, -- RatingStar
            classid_prefix || classid_suffix, -- ClassID
            'ST' || LPAD(i::TEXT, 4, '0') -- StudentID
        );
    END LOOP;
END;
$$;


