CREATE FUNCTION public.generate_students(start_id integer, end_id integer) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
  i integer := start_id;
  student_id text;
  first_name text;
  last_name text;
  student_name text;
  phone_prefix text;
  number integer;
  street_name text;
  city_name text;
  counselor_id text;
  is_duplicate boolean;
BEGIN
  WHILE i <= end_id LOOP 
    -- Generate StudentID
    student_id := 'ST' || LPAD(i::text, 4, '0');

    -- Generate unique StudentName
    LOOP
      first_name := public.generate_french_first_name();
      last_name := public.generate_german_last_name();
      student_name := first_name || ' ' || last_name;
      
      SELECT EXISTS(SELECT 1 FROM Student WHERE StudentName = student_name) INTO is_duplicate;
      IF NOT is_duplicate THEN
        EXIT;
      END IF;
    END LOOP;

    -- Generate unique PhoneNumber
    LOOP
      phone_prefix := (
        CASE
          WHEN random() < 0.2 THEN '031'
          WHEN random() < 0.4 THEN '032'
          WHEN random() < 0.6 THEN '033'
          WHEN random() < 0.8 THEN '034'
          ELSE '035'
        END
      );
      number := floor(random() * 10000000)::INT;
      
      SELECT EXISTS(SELECT 1 FROM Student WHERE PhoneNumber = phone_prefix || number) INTO is_duplicate;
      IF NOT is_duplicate THEN
        EXIT;
      END IF;
    END LOOP;

    -- Generate unique StudentAddress
    LOOP
      number := floor(random() * 1000) + 1;
      street_name := public.generate_street_name();
      city_name := public.generate_city_name();

      SELECT EXISTS(SELECT 1 FROM Student WHERE StudentAddress = number || ' ' || street_name || ', ' || city_name) INTO is_duplicate;
      IF NOT is_duplicate THEN
        EXIT;
      END IF;
    END LOOP;

    -- Generate CounselorID (as per your logic)
    counselor_id := 'CS' || LPAD(((i - 1) / 20 + 1)::text, 4, '0');

    -- Insert the new student record
      student_id,
      student_name,
      phone_prefix || number,
      number || ' ' || street_name || ', ' || city_name,
      counselor_id
    );

    i := i + 1;
  END LOOP;
END;
$$;


