CREATE FUNCTION public.update_ielts_scores() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
  student_status_record RECORD;
  ielts_score_diff REAL;
BEGIN
  FOR student_status_record IN SELECT * FROM public.student_status_at_class LOOP
    -- Randomly decide if we need to update the IELTS score
    IF random() < 0.5 THEN  -- 20% chance of updating
      -- Calculate the maximum difference between IELTS score and end course point
      ielts_score_diff := LEAST(1.5, student_status_record.endcoursepoint + (random() * 1.5)::INT * 0.5);
      
      -- Update the IELTS score
      UPDATE public.student_status_at_class
      SET ieltsscore = ielts_score_diff
      WHERE studentstatusid = student_status_record.studentstatusid;
    END IF;
  END LOOP;
END;
$$;


